import React from "react";
import navi from "../../assets/navi-1.jpg";

export const Home = () => {
  return (
    <div id="home">
      <img src={navi} alt="navi" className="sidebar--img" />
      <h3 style={{ color: "#999999" }}>Hello I'm</h3>
      <h1 className="name">Navdeep Singh</h1>
    </div>
  );
};
